var hashTable=new Object();$(document).ready(function(){jQuery.easing.def="easeInOutCubic";$(".project_thumb").each(function(a){$(this).children(".color_blocks").css("top",$(this).children("a").children("img").height());$(this).children(".metadata").css("top",$(this).children("a").children("img").height()+5)});$(".project_thumb").mouseenter(function(b){var c=$(b.currentTarget).children("a").children("img");var a=$(b.currentTarget).children(".color_blocks");a.stop();a.animate({top:0,height:c.height()+10},{duration:350})});$(".project_thumb").mouseleave(function(b){var c=$(b.currentTarget).children("a").children("img");var a=$(b.currentTarget).children(".color_blocks");a.stop();a.animate({top:c.height(),height:10},{duration:350})});$("p").each(function(){var b=$(this).text().split(" ");var a="";for(i=0;i<=b.length-1;i++){a+=b[i];if(i==(b.length-2)){a+="&nbsp;"}else{a+=" "}}$(this).html(a)})});